import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";

export default class Navbar extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
      };
  
    render() {
    return (
      <nav className="nav" id="navbar">
        <div className="nav-content">
          
          <ul className="nav-items">
            <li className="nav-item">
            <Link
                activeClass="active"
                to="section1"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                SOCIAL
              </Link>
            </li>
            <li className="nav-item">
                <Link
                activeClass="active"
                to="section2"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                MENTAL
              </Link></li>
            <li className="nav-item">HORMONAL 3</li>
            <li className="nav-item">INDUSTRIA 4</li>
            <li className="nav-item">SOBRE 5</li>
          </ul>
        </div>
      </nav>
    );
  }
}
